import {PUT_DATA} from "../types";

const initialState =[
          {
            "uid": 0,
            "name": "string",
            "comment": "string",
            "classViewProperty": "string",
            "dbTable": "string"
          }
        ]


const stateTable = (state = initialState, action) => {
    
    switch (action.type){
            
        case PUT_DATA:
            return  action.payload

            
        default: 
            return state;
    }
}
export default stateTable

//​/api​/ViewType
